import "bootstrap/dist/css/bootstrap.min.css";
import { useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
import Card from "react-bootstrap/Card";

function Foodsuccess() {
  const navigate = useNavigate();
  const styles = {
    cardstyle: {
      width: "29rem",
      marginBottom: "20rem",
    },
  };
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <div align="center">
          <Card style={{ width: "29rem" }}>
            <Card.Header>
              <h3>Donation Successfull</h3>
            </Card.Header>
            <Card.Body>
              <h4>Thank you for food donation</h4>

              <Button
                className="d-flex justify-content-center"
                onClick={() => {
                  navigate("/");
                }}
              >
                Submit
              </Button>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default Foodsuccess;
